/**********quick menu***************/
.quick_menu{
    width: 55px;
    border: 1px solid #ccc;
    position: absolute;
    right: 0px;
    top: 0px;
    z-index: 99998;
    background-color: #fff;
    transition: .3s;
}
.quick_menu:hover{
    width: 150px;
}
.quick_menu .quick_wrap{
    
}
.quick_menu .quick_wrap .quick_box{
    display: flex;
    border-bottom: 1px solid #ccc;
    height: 50px;
    line-height: 50px;
    
}
.quick_menu .quick_wrap .quick_box:nth-child(4){
    border-bottom: 0;
    
}
.quick_menu .quick_wrap .quick_box:nth-child(1){
    
}
.quick_menu .quick_wrap .quick_box .quick_icon{
    width: 30%;
    text-align: center;
   
}
.quick_menu .quick_wrap .quick_box .quick_icon i{
    font-size: 30px;
    color:#999;
    transition: .3s;
}
.quick_menu .quick_wrap .quick_box .quick_icon .usericon{
    padding-left: 11px;
    padding-top: 7px;
}
.quick_menu .quick_wrap .quick_box .quick_icon .truck{
    padding-left: 8px;
    padding-top: 10px;
}
.quick_menu .quick_wrap .quick_box .quick_icon .boxopen{
    padding-left: 7px;
    padding-top: 10px;
}
.quick_menu .quick_wrap .quick_box .quick_icon .quicksearch{
    padding-left: 10px;
    padding-top: 10px;
}
.quick_menu .quick_wrap .quick_box:hover i{
   color:#002053;
}


.quick_menu .quick_wrap .quick_box .quick_text{
    width: 0%;
    text-align: center;
    overflow: hidden;
    
}
.quick_menu .quick_wrap .quick_box .quick_text a{
    font-size: 16px;
    display: block;
    width: 100%;
}
.quick_menu .quick_wrap .quick_box .quick_text a:hover{
    color: #002053;
    font-weight: bold;
}

.quick_menu:hover .quick_wrap .quick_box .quick_text{
    /* display: block; */
    width: 70%;
}


/*********dir btn*********/

.dir_btn{
    width: 50px;
    line-height: 50px;
    text-align: center;
    position: fixed;
    bottom: 100px;
    right: 0;
    cursor: pointer;
    z-index: 9999;
    
}
.dir_btn .top_btn{
    width: 50px;
    height: 50px;
    font-size: 35px;
    color: #002053;
    
}

.dir_btn .bot_btn{
    width: 50px;
    height: 50px;
    font-size: 35px;
    color: red;
}
